export default function Rating(props){
    return (
        <>
            {
                props.rating.map((item) => {
                    return (<>
                        <div className="stars-outer">
                            <div
                                className="stars-inner"
                                style={{ width: item.rate }}
                            ></div>
                        </div>
                        
                    </>)
                })
            }
            <span className="number-rating">({props.rating.count})</span>
        </>
    );
}
